import "../styles/board.css";

export default function Board() {
  let board: number[][] = [];
  for (let i = 0; i < 9; i++) {
    let box: number[] = [];
    for (let j = 0; j < 9; j++) {
      box.push(0);
    }
    board.push(box);
  }
  console.log(board);
  return (
    <div className="board">
      {board.map((box, index) => {
        return (
          <div className="grid-box" id={index.toString()}>
            {box.map((cell, cellIndex) => {
              return (
                <div className="cell-item" id={cellIndex.toString()}>
                  <input
                    //value={cell != 0 ? cell : ""}
                    /*onChange={(e) => {
                      board[index][cellIndex] = Number.parseInt(e.target.value);
                    }}*/
                    className="input-cell"
                    contentEditable={true}
                  />
                </div>
              );
            })}
          </div>
        );
      })}
    </div>
  );
}
